(861, 15, 260, '20/5/13', 'The Temper Trap, Alex Murdochy, Eskimo Joe, Indie/Pop rock\nNever had singing lessons\nWants to get lessons just for fun.\nNever sings ever.\nPlays no other instruments - used to play a little bit of piano.\nWants to focus on breathing, vocal expression\nGetting into acting, so has some performance experience.\n\ndidn''t bring in a song / said he didn''t know any songs so we just did scales. Wasn''t the best class but he''s coming in next week with a song so should be a lot better then!\n\nSCALES: \nArt 5th - low A to G - (needs to smile more, take in less air, slide less, hit right pitches, sing AH instead of OR)\nArt 5-3-1 - low A to G (pronounce AH whole way through, take in less air, slide less)', 1369027642),
