(1495, 13, 234, 'Future or pending activity', 'week 1: go over song- girl on fire by alicia keys(having trouble with cry''s- belting not crying) dual breathing 80% 10% and ball. \n\nWeek 2: holding x2 scale, art cry, dual breathing (check last weeks if not doing well don''t start 80/20%yet)\n\nweek 3: Katy Perry Song (suggested this as she uses lower cry''s than previously worked on songs)\n\nweek 4: vbc (try an art 5th tuck but if she''s struggling just work on the tuck) 1358531, qmqfqlq', 1372156720),
(1496, 13, 132, 'Future or pending activity', 'Sinead has written me out a list of her favourite band''s singles. We''re going to be breaking them down so she can learn how they write to apply these techniques to her own songs. once covered 5+ please get her to write and bring in an original. She really wants to be a solo artist but is too shy and needs a bit of a push to get her music out there.\n\nWeek 1: Go over song (come as you are - nirvana cover by Yuna) make sure she''s using her techniques properly. Sometimes she gets stuck in a breathy falsetto. Revise Wah Cry (start at B below middle c and don''t go any higher than c#4)\n\nweek 2: Art Cry scale. dual breathing 80/20% and ball. (might be too nervous to let her stomach expand and tends to lean back. make sure she''s not doing those things)\n\nweek 3: New song from list.\n\nweek 4: revise song, holding x2. start vbc depending on how her breathing is going. ', 1372157327),
(1497, 13, 122, 'Future or pending activity', 'Claudia is working towards a goal. please check prior notes to view. Also similar to Sinead, has a list of her favourite artists singles.\n\nweek 1: war cry (get her crys going. she sometimes slips them to falsetto. get her to yell like she''s being kidnapped to find her true voice again) trill top and bottom 5th scale. get her to sing Bottle of whiskey by tinpan orange accapella, make sure she''s controling her notes.\n\nweek 2: new song from list.\n\nweek 3: quick art octave slide. (get her to cry not slip into falsetto) revise song\n\nweek 4: new song from list', 1372157718),
