(1746, 15, 308, '1st lesson', 'Jane Tirrel (The Herd), Paris Wells, Alli Goulding, Older Alicia Keys.\nHad some lessons in high school.\nWas in girls choir at age 8, always singing till 17.\nNo solo singing experience, but experience in a group. Gets nervous.\nGOALS: ultimate goal: join hip-hop group as clean singer. Goal for end of year: have done some sort of singing on stage.\nwants to start writing songs. Writes lyrics occasionally.\nMesses around on piano.\nWants to improve volume, more strength in upper and lower register, wants an improved range.\n\nWORK ON: mouth placement, volume, projection, cries, support, AIRY\n\nArt 5th: from G up to D (always keep in true voice, dont push through too much air, pyramid the volume.) \none in volume: C to G (smile more, dont push through too much air.)\nSee 5th: from G up to D.\n', 1373270374),
