(2225, 24, 374, '1st lesson', 'No vocal lessons\nPlays guitar, piano, writes own songs, records on dance tracks\nMain thing is confidence building for performance \nTOP 3 GOALS:\n1. Vocal control\n2. Confidence in singing (singing soft and belting out)\n3. Overcoming stage fright to perform in near future \nINFLUENCES\nAdele (Hometown Glory)\nBon Iver (Flume, Skinny Love)\nBoys & Bear\nBeyonce ', 1376110725),
(2226, 24, 374, 'Songs', 'Adele Hometown Glory - great lower tones, need to work on strength on higher notes and confidence expressing song (light and shade)\nPicking another song for next week', 1376110796),
(2227, 24, 374, 'Scales', 'Art 5th scale - High C - to increase confidence with higher notes (from F above mid C) slap away each note in scale with hand movement (really worked to increase confidence and strength in higher part of piano).\n\nFuture scales: Crys to increase confidence up high. Lower scales to work her gorgeous low tones. Soul triad. Something to bring her out of her shell (Yeah Yeah Yeah - with hand movement)  ', 1376110990),
(2228, 24, 277, 'Songs', 'Worked on songs for student concert - Stay and Where I stood, also ran through Valerie for confidence and energy release (releasing nerves before tomorrow). Started nervous, by end was excited and eager to perform. \nFuture songs: Kissing You (Desiree) - aim is to play on piano whilst singing \nOpen mic nights for performance experience and expression release ', 1376111092),
