(3927, 26, 290, 'Admin', 'Jake wont be attending lessons until after the first week of Feburary as his mum isn''t sure when she''ll be able to get him there until he gets his school time table.', 1388963428),
(3928, 24, 527, '1st Lesson', 'Songwriting \nSoul / rock / metal\nInfluences: Florence and Machine, Aretha, Paramore, Vanessa Amarossi, Amy Winehouse, Arcade Fire, Nightwish, Epica\nGoals:\nContribute to Artful Dodger \n\n', 1389774364),
(3929, 24, 527, '1st Lesson', 'Key goals:\n1. Stamina (breathing)\n2. Extend range (skew to higher)\n3. Song development - music and words together ', 1389774426),
(3930, 24, 527, 'Scales', 'Art High D\nImprove: breathing, pitching, light and shade\nStrengths: nice higher tones, good emotion, natural singer ', 1389774474),
