(3933, 24, 400, 'Songs', 'Revised Feelin'' good by Nina Simone \n- needs to open mouth, use vowels more\n - work on cries ''freedom, mine''\n- work on finishing sentences \n\nNew songs:\nUnbreak my heart\nPaid my dues ', 1389775478),
(4100, 24, 400, 'Scales', 'Down MA 5th F# - focus upper register (strong head voice) \nArpeggio - soft and smooth flow \nSoul Bb low fifth down\nGoog FS High G\nFla la la Fifth Down Deep - low G to high C\nMa 5th down with soul (back end focus)\nVBC triad High D \nArt / Ma 5th down scale \nFla la la Low A\nTrill 121 hold HIgh D \nSoul La VBC white notes top C\nArpeggio G to C# alternate ', 1403309980),
(3935, 24, 400, 'Test/Revision', 'Ma up and down 5th - High High E\nMA up / down 5th broke new ground with placement - high high F \n\nSoul la revision + 531 dry cry (getting on top of note, sobbing) \n\nRevised soul triad, vowel, art dry cry 5.3.1\n\nRevised Heart Cry down 5th\nFla la la\nWee Wee Wee\n\nRevised Art 5-3-1 dry cry - F# (mouth placement) ', 1409359588),
(3936, 24, 400, 'Test/Revision', 'Volume scale one in - high D\nArt dry cry 531 power \nMa Ma Ma lower register attitude  ', 1403857459),
(3937, 24, 400, 'Future or Pending Scales', 'Holding\nJumps 151\nRevise vowels ', 1389775667),
(3938, 24, 512, '1st Lesson', 'Influences - Little Mix (move, Little Me, Wings)\nOne Direction (Story of my life, One Way)\nJesse J (Price tag)\nKatie Perry (Roar) \n\nGoals:\n1. breathing\n2. high notes\n3. control (not shaky)\n\nDiagnostics / teacher goals:\n- timing / rhythm \n- great vibrato and tone \n- loves singing\n- confidence / nerves \n- vowels (mouth placement)\n- breathing (takes too many little breaths)\n- Light and shade ', 1389775894),
(3939, 24, 512, 'Breathing/Ball', 'Revised breathing 80/10\n\nShowed basic breathing technique (through diaphragm) ', 1392438989),
(3940, 24, 512, 'Future or Pending Scales', 'Jumps (Dark Horse) \n12345 (dictation) \nMa scale (smooth)\nSoul scale\nHeart \nBasic trill\nC scale - as ''me'' \nYou scale\nFull vowel scale \nThen introduce some triads \nStage presentation / basic dance moves \n\n', 1398490064),
(3941, 24, 277, 'Test/Revision', 'Revised ''people get ready'' (best yet; feeling, light n shade, pitching better)\nMore focus this year on songs \n', 1389776266),
(3942, 24, 277, 'Songs', 'Jessica Rabbit ''why don''t you do it right'' - sexy, smooth, feeling and consideration ', 1389776319),
(3943, 24, 277, 'Future or Pending Scales', 'Deep power soul tone scale \nPITCHING\nWhoo ohh ohh or Mee Mee Mee (FS / transition scale) \nVolume\nHolding\nPitching \nYodel ', 1394435560),
(3944, 24, 374, 'Songs', '"Say Something" A great Big World \nConnection point - work on  head and true (confidence and ease), emotion and connection to song great, focus on mouth finishing each line \n\nNext week - "You lost me" Christina \n\nAIM: bring out power of Kira - light n shade, stage presentation / confidence ', 1389776474),
(3945, 24, 374, 'Future or Pending Scales', 'TRILLS RNB \nSoft scale for control and beauty \nRAA - growl and power\nVolume (?)\nWhow - open mouth right up (rock and feeling) \n', 1389776658),
(3946, 24, 514, '1st Lesson', 'History:\nSome musical theatre, some drums, trumpet, trombone, writes some own music using Ableton (bro''s a producer)\n\nInfluences:\nMixed 80s sound and vocals (e.g. Dead or Alive) \nPop music \nSkin to Bone\nJungle Giants\nAndy Bull (Baby I''m nobody now)\n\nTop 3 singing goals:\n1. sound good\n2. Develop own style\n3. Sing in tune \n\nDiagnostics:\nAt first way of note but once settled was on key. \nAmazing lower tones, end of keyboard\nGreat tone in voice \nNatural singer just needs to train ear / increase confidence \n\nSang "You and I" Lady GaGa - off key, great lower tones - EAR training key\nGreat character potential / strong presence \n\nKey areas to work on:\n1. Pitch\n2. Breathing\n3. Range\n4. Mouth placement \n', 1389776944),
(3947, 24, 514, 'Breathing/Ball', 'Showed basic diaphragmatic breathing - picked up fast \nShowed ball \nBreathing exercises for Prince', 1400302997),
