(4103, 24, 512, 'Scales', 'Revised Ma up down fifth, worked on placement and support from diaphragm (wants to sing high notes more easily)\nSirens & Ready For - mid placement \nRap exercise 1 - 1 to 10 (7 strikes each number)\nThird jump - low F to Mid A\nHigh notes for Dark Horse \nSoul triad C mid to D#\nDictation: 123454321 F to C# \nTrill and hold C#\nWee wee wee High E \nMA soft cry scale High D \nAEIOU alternate high G ', 1408776254),
