(4496, 26, 330, 'Future or Pending Scales', 'Lesson 1: run through london grammar song. try and get her looking in the mirror (be fun about it though cause she hates it) give or revise air see heart soul you scale (don''t have record of her having this scale but I have a feeling she may have it. her mouth movements need a lot of work, remind her to do her jaw stretches) ask her to bring a new song the next week.\n\nLesson 2: ask her how her practice went during the week and if she had trouble with anything, remind her about her jaw stretches. start new song break down.\n\nLesson 3: ask her how her weeks prac went. try to consistently encourage her without badgering. Run through song, apply any adjustments to her use of technique. Run through her diaphragmatic breathing, if she does it well show her 80/10', 1394540476),
