(5871, 24, 956, '1st Lesson', 'Previous training (6 years off) & regional theatre - very strong voice and big range\nSong: Ave Maria Katie Price \nTo work on:  singing own authentic voice (has been basing self on others, now find true voice), nerves / relaxing and letting voice flow, tidy cries\n"Making singing fun and bringing out the real you"\n- Lower scales (soul and depth)\n- Cries (smooth top end)\n- Breath / relaxing\n- Pitch \n- Confidence\n- Ung\n\nTop Goals (from Emma):\n- Transitions\n- Control when belting\n- Reading music\n- Breathing / letting go \n\nInfluences:\n- Burlesque soundtrack\n- Alicia Keys \n- Whitney\n- Christina \n\nPhone: 0413 845  960', 1400916018),
(5872, 24, 955, '1st Lesson', 'Daughter of musician\nLoves soul / rnb; Lauren Hill, Decode, Evanescence \nSongs: If I ain''t got you, Right here (SWV)\n\nD''s goals:\n- still trying to find own voice\n- bring out strong voice without sore throat\n- transitions \n- control \n- musicianship\n- eventually learn guitar \n\nTo work on:\n- great soul & natural performer, feels emotion\n- open vowels / articulation / dictation\n- breathing for power\n- projection\n\nCOMMON EXERCISES FOR D AND EM:\n- Breathing stage 1 revise\n- Soul scales\n- Heart cry\n- Transition warm up (e.g. Ung)', 1400916399),
